PREFIX brick: <https://brickschema.org/schema/1.3/Brick#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT ?zone
       (GROUP_CONCAT(DISTINCT ?propLabel; SEPARATOR=", ") AS ?nonWritablePropertyLabels)
       (GROUP_CONCAT(DISTINCT ?alcEndpoint; SEPARATOR=", ") AS ?ALCEndpoints)
       (GROUP_CONCAT(DISTINCT ?mpcEndpoint; SEPARATOR=", ") AS ?MPCEndpoints)
WHERE {
  # Zones (targets)
  ?zone a brick:Zone .

  # Nonâ€‘writable properties associated with the zone
  OPTIONAL {
    ?zone brick:hasProperty ?prop .
    ?prop brick:writable false .
    OPTIONAL { ?prop rdfs:label ?propLabel . }
  }

  # ALC endpoint references
  OPTIONAL {
    ?zone brick:hasReference ?alcEndpoint .
    ?alcEndpoint a brick:ALCEndpoint .
  }

  # MPC endpoint references
  OPTIONAL {
    ?zone brick:hasReference ?mpcEndpoint .
    ?mpcEndpoint a brick:MPCEndpoint .
  }
}
GROUP BY ?zone
ORDER BY ?zone
